"_embedded_player_sample":["<style type=\"text/css\">\n",{"blocks":[{"attachment":["\n    ",{"from":"\"sampleplayer_tall\"","to":"playerclass","type":"assign"},"\n    ",{"from":"\"samplecontext_tall\"","to":"contextclass","type":"assign"},"\n"],"child_condition":null,"child_relation":null,"left":"size","operator":"==","right":"\"tall\"","type":"condition"},{"attachment":["\n    ",{"from":"\"sampleplayer_wide\"","to":"playerclass","type":"assign"},"\n    ",{"from":"\"samplecontext_wide\"","to":"contextclass","type":"assign"},"\n"],"type":"else_condition"}],"type":"if"},"\n\n</style>\n<!--<div class=\"sampleheader\">-->\n<!--<span style=\"font-size:93%\">A fictitious blog post to give you an idea of how the player would look <em>in situ</em>:</span><br><br>-->\n<!--\n<div class=\"heading\">\n    Preview:<br><br>\n",{"blocks":[{"attachment":[{"filters":[["h",[]]],"name":"album_title","type":"variable"}],"child_condition":null,"child_relation":null,"left":"tralbum_param.name","operator":"==","right":"\"album\"","type":"condition"},{"attachment":[{"filters":[["h",[]]],"name":"title","type":"variable"}],"type":"else_condition"}],"type":"if"}," by ",{"filters":[["h",[]]],"name":"artist","type":"variable"},"-->\n</div>\n<!--",{"filters":[],"name":"today","type":"variable"},"\n</div>-->\n<!--<div class=\"",{"filters":[],"name":"playerclass","type":"variable"},"\" style=\"width: ",{"filters":[],"name":"width","type":"variable"},"px; height: ",{"filters":[],"name":"height","type":"variable"},"px;\">-->\n<div class=\"sampleplayer_wide\" style=\"width: ",{"filters":[],"name":"width","type":"variable"},"px; height: ",{"filters":[],"name":"height","type":"variable"},"px;\">\n    \n    ",{"template_name":"'_embedded_player'","type":"include"},"\n</div>\n<!--\n<div class=\"",{"filters":[],"name":"contextclass","type":"variable"},"\">\n<p class=\"blather\">\nThe incredibly simple melody of the short 'Bocuma' becomes a lump-in-the-throat meditation on man's place in the universe through subtle pitch shifts and just the right mist of reverb. The slow fade-in on 'An Eagle in Your Mind' is the lonesome sound of a gentle wind brushing the surface of Mars moments after the last rocket back to Earth has lifted off.\" Why not listen to, Only the Proletariat Floss's by Screaming at the Mirror. With a truncated syncopation and approach that rivals only Tosh Guarrez pre \"FartFlap\", \"S.A.T.M\" has taken steps to dismantle what was previously only dared mantled by the great Gilda Thrush when she fronted \"Cycle Clause\". It's as if Genghis Kahn got together for breakfast with Oliver Wendell Holmes and Virginia Wolfe and ordered just a bowl of homemade granola and then skipped out on the check. RATING: 11.-111 <a href=\"http://www.pitchforkmedia.com/article/feature/10279-guest-list-david-cross-albums-to-listen-to-while-reading-overwrought-pitchfork-reviews\">-David Cross</a>\n</p>\n</div>-->\n"],
